alphabet = 'OlZEASbTBg'
mapping = {v: str(i) for i, v in enumerate(alphabet)}

def decode(s):
	return int(''.join([mapping[e] for e in s]))

N = decode(N)
e = decode(e)
c = decode(c)

print('python RsaCtfTool.py -n {} -e {} --uncipher {}'.format(N, e, c))

